ControlPropertyState.AutoRuleBindingString:
ClearCollect(
    collSteps,
    {
        step:1,
        stepText: "Personal",
        stepFlag: 1,
        isCurrent: true
    },
    {
        step:2,
        stepText: "Academics",
        stepFlag: 1,
        isCurrent: false
    },
    {
        step:3,
        stepText: "Extra-curriculars",
        stepFlag: 1,
        isCurrent: false
    },
    {
        step:4,
        stepText: "Summary",
        stepFlag: 1,
        isCurrent: false
    }
);

If(
    PasswordTF.Text = confirmPasswordTF.Text,
    If(
        //check if any user with email exist
        CountRows(
            Filter(
                Users,
                EmailTF.Text = Email
            )
        ) = 0,
        //if it doesnt exist allow to register
        Patch(
            Users,
            Defaults(Users),
            {
                Title: Lower(
                    Concatenate(
                        FirstNameTF.Text,
                        ".",
                        LastNameTF.Text,
                        RandBetween(
                            100,
                            999
                        )
                    )
                ),
                FirstName: FirstNameTF.Text,
                LastName: LastNameTF.Text,
                Email: EmailTF.Text,
                PhoneNumber: PhoneNumberTF.Text,
                Nationality: NationalityRB.Selected.Value,
                CNIC: If(
                    NationalityRB.Selected.Value = "Pakistani",
                    CNICTF.Text,
                    ""
                ),
                PassportNumber: If(
                    NationalityRB.Selected.Value = "Pakistani",
                    "",
                    CNICTF.Text
                ),
                Country: If(
                    NationalityRB.Selected.Value = "Pakistani",
                    "Pakistan",
                    Country.Selected.Value
                ),
                ProgramsInterestedIn: ProgramsDropDown.Selected.Value,
                Password: PasswordTF.Text
            }
        );
        //Save Users info in local app collection and navigate
        Collect(
            User,
            Filter(
                Users,
                LoginTF.Text = Email
            )
        );
        Navigate(
            'Home Screen',
            ScreenTransition.Fade
        ),
        //else notify the error
        Notify(
            "Account with same email, try Login.",
            NotificationType.Error
        )
    ),
    Notify(
        "Password and Confirm Password do not match.",
        NotificationType.Error
    )
);

